Mongoose deep populate() returns empty array<p>I need a help on mongoose deep population. Basically, I have an <code>ItemGroupSchema</code> having a <code>_id</code> referenced to <code>ItemSchema</code> and <code>items</code> being an array of references to <code>ItemSchema</code> as well.</p>
<pre><code>const ItemSchema = new mongoose.Schema&lt;IItem&gt;({
    // information fields about item type, quantity, model, size,...
}); // its model is ItemModel

const ItemGroupSchema = new mongoose.Schema&lt;IItemGroup&gt;({
    _id: { type: mongoose.Schema.Types.ObjectId, required: true, ref: ItemModel.modelName },
    items: [{ type: mongoose.Schema.Types.ObjectId, ref: ItemModel.modelName }]
}, { _id: false }); // its model is ItemGroupModel
</code></pre>
<p>From a valid <code>_id</code> input, I do the following:</p>
<ol>
<li>Get the <code>items</code> of it from <code>ItemGroupModel</code>; done.</li>
<li>With the <code>items</code> of <code>_id</code> I got, I populate it from ItemGroupSchema so I can have <code>items</code> of <code>items</code> of <code>_id</code>; done.</li>
<li>Now, I should have <code>items</code> of <code>items</code> inside <code>items</code> of <code>_id</code>. Next is to populate only on <code>items</code> of <code>_id</code> from <code>ItemSchema</code> to have some information to work on, which is not done yet.</li>
</ol>
<p>The issue is that, <code>populate()</code> operation of the last step gives me an empty <code>items</code> array. Below is how each operation looks like step by step:</p>
<pre><code>1.
ItemGroupModel.find({ _id: 'root' });
{
  _id: 'root',
  items: ['parent1', 'parent2']
}

2.
ItemGroupModel.find({ _id: 'root' }).populate({ path: 'items', model: ItemGroupModel.modelName });
{
  _id: 'root',
  items: [
    { _id: 'parent1', items: ['child1', 'child2'] },
    { _id: 'parent2', items: ['child3']
  ]
}

3.
ItemGroupModel.find({ _id: 'root' }).populate({ path: 'items', model: ItemGroupModel.modelName, populate: { path: '_id', model: ItemModel.modelName }});
{
  _id: 'root',
  items: [] // yes, empty
}

// I expect it to be
{
  _id: 'root',
  items: [
    { _id: { _id: 'parent1', type: 'gun', quantity: 1, size: 1 }, items: ['child1', 'child2'] },
    { _id: { _id: 'parent2', type: 'backpack', quantity: 1, size: 1 }, items: ['child3']
  ]
}
</code></pre>

