    {
        &quot;datetime&quot;: &quot;28/08/2021 16:01:00&quot;,
        &quot;sensor&quot;: {
            &quot;id&quot;: 1,
            &quot;type&quot;: &quot;Temperature&quot;
        },
        &quot;value&quot;: 2502
