<p>However, I am noticing that no Sensor-objects are created inside MongoDB, only DataEntries - why is that? And how can I create Sensor-objects as well?</p>
<p>Of course, a DataEntry object has the sensor attached but if I call <code>Sensor.find().then( sensors =&gt; res.json(sensors) )</code> an empty array is returned.</p>

