MongoDB and .netCore Find nearest locations (unable to find index for $geoNear query)<p>I'm trying to find nearest other locations form my MongoDB database.</p>
<p>I'm using .net Core as rest API.</p>
<p>.net Core 5.0</p>
<p>This is my MDB Class</p>
<pre><code>public class MdbTrip
{
        [BsonId]
        [BsonRepresentation(MongoDB.Bson.BsonType.ObjectId)]
        public string id { get; set; }

        public GeoJsonPoint&lt;GeoJson2DGeographicCoordinates&gt; location { get; set; }

}
</code></pre>
<p>This is the way I fond to make the query (To find nearest other locations within 200m).</p>
<pre><code> var point = GeoJson.Point(GeoJson.Geographic(myLocation.lng, myLocation.lat));
 var locationQuery = new FilterDefinitionBuilder&lt;MdbTrip&gt;().Near(tag =&gt; tag.location, point, 200);
 var c = _trips.Find(locationQuery).ToList();
</code></pre>
<p>_trips is Injected with a interface and it represents IMongoCollection.</p>
<p>My objects are saving perfectly find in the database (DB connection is fine).
